import {
    Document,
    Paragraph,
    Packer,
    AlignmentType,
    TextRun,
    ImageRun
} from 'docx';


import logo from './logo144.png';

const ulu_logo = `

`

export const createDoc = async (story) => {
    let arraycomments = [];
    if(story.comments && story.comments.length > 0){
        arraycomments=story.comments.map(item => (
            item.name && item.date && item.comment && (
          new Paragraph({
                children: [
                    new TextRun({
                        text: item.comment,
                        font: 'Arial',
                        size: 32,
                        bold: false,
                    }),
                ]
            }))
        ))
    }
    const structureDoc = [
        new Paragraph({
            children: [
                new ImageRun({
                    data: Uint8Array.from(atob(ulu_logo), c =>
                    c.charCodeAt(0)
                  ),
                    transformation: {
                        width: 100,
                        height: 100
                    }
                }),
            ],
            alignment: AlignmentType.CENTER
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: '',
                    font: 'Arial',
                    size: 52,
                    bold: true,
                }),
            ],
            alignment: AlignmentType.CENTER
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: story.title,
                    font: 'Arial',
                    size: 52,
                    bold: true,
                }),
            ],
            alignment: AlignmentType.CENTER
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: story.answers_zero,
                    font: 'Arial',
                    size: 32,
                    bold: false,
                }),
            ]
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: story.answers_first,
                    font: 'Arial',
                    size: 32,
                    bold: false,
                }),
            ]
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: story.answers_second,
                    font: 'Arial',
                    size: 32,
                    bold: false,
                }),
            ]
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: story.answers_third,
                    font: 'Arial',
                    size: 32,
                    bold: false,
                }),
            ]
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: story.answers_fourth,
                    font: 'Arial',
                    size: 32,
                    bold: false,
                }),
            ]
        }),
        new Paragraph({
            children: [
                new TextRun({
                    text: '',
                    font: 'Arial',
                    size: 52,
                    bold: true,
                }),
            ],
            alignment: AlignmentType.CENTER
        }),
        story.comments && story.comments.length > 0 ?
 
        new Paragraph({
            children: [
                new TextRun({
                    text: 'Comments',
                    font: 'Arial',
                    size: 40,
                    bold: true,
                }),
            ]
        })

        
        :         new Paragraph({
            children: [
                new TextRun({
                    text: 'Not comments',
                    font: 'Arial',
                    size: 40,
                    bold: true,
                }),
            ],
            alignment: AlignmentType.CENTER
        }),

    ]

    
    const MyDocument = new Document({
        sections: [
            {
                /*
                Uint8Array.from(atob(imageBase64Data), c =>
                    c.charCodeAt(0)
                  ),
                */
                children: story.comments && story.comments.length > 0 ? structureDoc.concat(arraycomments): structureDoc
            }
        ]
    })
    console.log(MyDocument)

    return await Packer.toBlob(MyDocument).then(blob => {
        let a = document.createElement("a");
        document.body.appendChild(a);
        a.style = "display: none";
        let url = window.URL.createObjectURL(blob);
        
        a.href = url;
        a.download = `${story.title}.docx`;
        a.click();
        document.body.removeChild(a);

        return blob;
    })
/*
    return await Packer.toBuffer(MyDocument).then(buffer => {
        let blob, url;
        blob = new Blob([buffer], {
          type: 'application/octet-stream'
        });

        let a = document.createElement("a");
        document.body.appendChild(a);
        a.style = "display: none";
        url = window.URL.createObjectURL(blob);
        
        a.href = url;
        a.download = `${story.title}.docx`;
        a.click();
        document.body.removeChild(a);

        return blob;
    })*/
}